import React from 'react';
import s from './Card.module.css';

const Card = (props) => {
  const cardList = props.cards.map((card) => {
    return (
      <li>
        {card.name} {card.description}
      </li>
    );
  });
  return <div className={s.card}>{props.children}</div>;
};

export default Card;
